IMAGE_BASE = "https://pc-ap.renttherunway.com/"
REVIEW_IMAGE_BASE_URL = 'https://reviews-as.renttherunway.com/'


def fetch_product_images():
    r = requests.get(CATALOG_URL)
    products = json.loads(r.text)
    product_images = {}
    for product in products:
        try:
            if product["published"] and product["type"] in DRESS_TYPES:
                product_images[product["id"]] = IMAGE_BASE + product["images"]["front"]["270x"]
        except KeyError:
            pass
    return product_images


def fetch_dress_styles():
    r = requests.get(CATALOG_URL)
    products = json.loads(r.text)
    dress_styles = {}
    for product in products:
        try:
            if product["published"] and product["type"] in DRESS_TYPES:
                dress_styles[product["id"]] = True
        except KeyError:
            pass
    return dress_styles


def fetch_product_types():
    r = requests.get(CATALOG_URL)
    products = json.loads(r.text)
    product_types = {}
    for product in products:
        try:
            if product["published"]:
                product_types[product["type"]] = True
        except KeyError:
            pass
    return product_types


IMAGE_SERVICE_URL = 'http://imgfs01.stage.renttherunway.it:8888'
PREPROCESSED_ENDPOINT = IMAGE_SERVICE_URL + '/reviewImages/preprocessed'


def put_preprocessed_image(photo_id, image_file):
    r = requests.put(PREPROCESSED_ENDPOINT, data={'photoId': photo_id}, files={'file': open(image_file, 'rb')})
    if r.status_code == 200:
        return r.json()
    else:
        raise


