def get_original_image_url(doc):
    return REVIEW_IMAGE_BASE_URL + doc['relUrls']['imageOriginal']


def get_id_and_original_image_url(doc):
    return doc['_id'], REVIEW_IMAGE_BASE_URL + doc['relUrls']['imageOriginal']
